var owoify = class {
  start() {
    Commands.register({
      name: "owoify",
      description: "owoify your text",
      options: [
        {
          type: Commands.Types.OptionTypes.STRING,
          name: "message",
          description: "The message to owoify",
          required: true
        },
        {
          type: Commands.Types.OptionTypes.STRING,
          name: "post id",
          description: "The post id of what translator you want to use.",
          required: true,
          choices: options.splice(options.length / 8).map((post) => ({ name: post.title, value: post.postID }))
        }
      ],
      execute: async (args, { channel }) => {
        const data = await Net.fetch("https://anythingtranslate.com/wp-admin/admin-ajax.php", {
          "headers": {
            "User-Agent": "Mozilla/5.0 (Windows NT 10.0; Win64; x64; rv:145.0) Gecko/20100101 Firefox/145.0",
            "Accept": "*/*",
            "Accept-Language": "en-US,en;q=0.5",
            "Content-Type": "application/x-www-form-urlencoded; charset=UTF-8",
            "X-Requested-With": "XMLHttpRequest",
            "Sec-GPC": "1",
            "Sec-Fetch-Dest": "empty",
            "Sec-Fetch-Mode": "cors",
            "Sec-Fetch-Site": "same-origin",
            "Priority": "u=0",
            "Pragma": "no-cache",
            "Cache-Control": "no-cache"
          },
          "referrer": "https://anythingtranslate.com/translators/uwuifier-translator/",
          "body": `action=do_translation&translator_nonce=e2cae918cc&post_id=${args[1].value}&to_translate=${encodeURI(args[0].value.split(" ").join("+"))}&translation_model=newest&is_language_swapped=0`,
          "method": "POST",
          "mode": "cors"
        });
        return sendMessage((await data.json()).data, channel.id);
      },
      id: "owoify"
    });
  }
  stop() {
    Commands.unregisterAll();
  }
};
